[{"location":"adding_search_benchmarks/#Adding-Search-Benchmarks","page":"Adding Search Benchmarks","title":"Adding Search Benchmarks","text":"","category":"section"},{"location":"adding_search_benchmarks/","page":"Adding Search Benchmarks","title":"Adding Search Benchmarks","text":"We had our first meeting, and we discussed what would be the flow of the entire internshiop and also discussed how to go about the first deliverable as per the proposal which is Adding Search Benchmarks.  ","category":"page"},{"location":"adding_search_benchmarks/","page":"Adding Search Benchmarks","title":"Adding Search Benchmarks","text":"We discussed what should be the language of choice for writing scripts for benchmarking, we had two possible candidates, one was Julia (for obvious reasons, since the whole repo is in Julia) and the other one was JavaScript since the search functionality is implemented in JavaScript so it would be easier to interact with the search functionality.  ","category":"page"},{"location":"adding_search_benchmarks/","page":"Adding Search Benchmarks","title":"Adding Search Benchmarks","text":"We talked about it and thought of JavaScript as a better choice but now I think of it, I belive the barebone architecture for benchmarks should be in Julia only so that in future if anybody want to add more benchmarks or new tests they can do it easily as I am expecting most of the people coming in the Documenter repo are coming from Julia background and as far as talking to the JavaScript based search functionality we can see how to talk it through Julin in coming days.","category":"page"},{"location":"adding_search_benchmarks/#Implementation","page":"Adding Search Benchmarks","title":"Implementation","text":"","category":"section"},{"location":"adding_search_benchmarks/","page":"Adding Search Benchmarks","title":"Adding Search Benchmarks","text":"I started with creating a basic struct which stores the search query and what should be the expected docs in the following manner :","category":"page"},{"location":"adding_search_benchmarks/","page":"Adding Search Benchmarks","title":"Adding Search Benchmarks","text":"struct TestQuery\n    query::String\n    expected_docs::Vector{String}\nend","category":"page"},{"location":"adding_search_benchmarks/","page":"Adding Search Benchmarks","title":"Adding Search Benchmarks","text":"we can then compare it with the actual result and find out the different benchmarks","category":"page"},{"location":"#Improving-Search-functionality-for-Documenter.jl","page":"Home","title":"Improving Search functionality for Documenter.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This site is a collection of notes, progress reports for the 2025 Google Summer of Code (GSoC) project by @Rahban1, mentored by @mortenpi and @Hetarth02.","category":"page"},{"location":"","page":"Home","title":"Home","text":"I thought it would be a good idea to document my journey using Documenter itself, also I was inspired by my mentor Morten who did the same :)","category":"page"}]
